import React from 'react'
const ComputerItem = ({computer}) => {
    const handleDelete = () => {
        console.log(computer.id)
    }
    return(
    <tbody>
        <tr>
            <th scope="row">{computer.id}</th>
            <td>{computer.name}</td>
            <td>{computer.id_computer}</td>
            <td>{computer.id_monitor}</td>
            <td>{computer.anydesk}</td>
            <td>{computer.switch}</td>
            <td>{computer.puert}</td>
            <td>{computer.ip}</td>
            <td><button className='btn btn-success'>Editar</button></td>
            <td><button onClick={()=>computer.id && handleDelete(computer.id)} className='btn btn-danger'>Borrar</button></td>
        </tr>  
    </tbody>
      
        
  
    )
}

export default ComputerItem;
